// Main function
function main() {
  if (!/illustrator/i.test(app.name)) {
    alert('Wrong application\nRun script from Adobe Illustrator', 'Script error');
    return;
  }

  if (!app.documents.length) {
    alert('No documents\nOpen a document and try again', 'Script error');
    return;
  }

  var doc = app.activeDocument;
  var selSwatches = getSwatches(doc);
  var selSwNames = getSwatchNames(selSwatches); // User-selected swatch names
  var unselSwNames = getSwatchNames(doc.swatches); // Other swatch names
  unselSwNames = filterArray(unselSwNames, selSwNames);
  var existsCount = 0;

  if (!selSwatches.length) {
    alert("No swatches are selected\n" 
      + "or there's a technical problem. Try restarting Adobe Illustrator", "Script Error");
    return;
  }

  CFG.namesPerPage = Math.min(CFG.namesPerPage, selSwatches.length);

  var totalPages = Math.ceil(selSwatches.length / CFG.namesPerPage);
  var currPage = 1;
  var editedNames = selSwNames.slice();

  // DIALOG
  var win = new Window('dialog', SCRIPT.name + ' ' + SCRIPT.version);
      win.alignChildren = ['fill', 'fill'];
      win.spacing = 15;

  // NAMES
  var namesGrp = win.add('group');
      namesGrp.alignChildren = ['fill', 'top'];

  // OLD NAMES, read-only
  var oldNameGrp = namesGrp.add('group');
      oldNameGrp.orientation = 'column';
      oldNameGrp.alignChildren = ['fill', 'top'];

  oldNameGrp.add('statictext', undefined, 'Current Names: ');
  var oldNameInp = oldNameGrp.add('edittext', undefined, '', {multiline: true, scrolling: false, readonly: true });
      oldNameInp.preferredSize.width = 150;
      oldNameInp.preferredSize.height = CFG.listHeight;

  // NEW NAMES
  var newNameGrp = namesGrp.add('group');
      newNameGrp.orientation = 'column';
      newNameGrp.alignChildren = ['fill', 'top'];

  newNameGrp.add('statictext', undefined, 'New Names: ');
  var newNameInp = newNameGrp.add('edittext', undefined, '', {multiline: true, scrolling: false, readonly: false });
      newNameInp.preferredSize.width = 150;
      newNameInp.preferredSize.height = CFG.listHeight;

  if (CFG.isMac || CFG.aiVers >= 26.4 || CFG.aiVers <= 17) {
    newNameInp.active = true;
  }

  // CONTROLS
  var wrapper = win.add('group');
      wrapper.alignChildren = ['fill', 'top'];
      wrapper.spacing = 15;

  var options = wrapper.add('group');
      options.orientation = 'column';
      options.alignChildren = ['fill', 'top'];
      options.spacing = 15;

  // PAGINATION
  var pagGrp = options.add('group');
      pagGrp.alignChildren = ['left', 'center'];

  var prevPageBtn = pagGrp.add('button', undefined, '<');
      prevPageBtn.preferredSize.width = 30;
      prevPageBtn.enabled = currPage > 1;

  pagGrp.add('statictext', undefined, 'Page: ');

  var pagInp = pagGrp.add('edittext', undefined, 1);
      pagInp.characters = 3;

  pagGrp.add('statictext', undefined, 'of ' + totalPages);

  var nextPageBtn = pagGrp.add('button', undefined, '>');
      nextPageBtn.preferredSize.width = 30;
      nextPageBtn.enabled = currPage < totalPages;

  var tolGrp = options.add('group');
      tolGrp.alignChildren = ['left', 'center'];

  tolGrp.add('statictext', undefined, 'Search Tolerance: ');
  var tolInput = tolGrp.add('edittext', undefined, CFG.defTolerance);
      tolInput.characters = 8;

  var resLabel = options.add('statictext', undefined, 'Matched Names: 0 of ' + selSwatches.length);
      resLabel.preferredSize.width = 200;

  var btns = wrapper.add('group');
      btns.orientation = 'column';
      btns.alignChildren = ['fill', 'fill'];
      
  var closeBtn = btns.add('button', undefined, 'Close', {name: 'cancel'}); 
  var matchBtn = btns.add('button', undefined, 'Match Names', {name: 'find'}); 
  var okBtn = btns.add('button', undefined, 'Rename', {name: 'ok'});
      okBtn.helpTip = 'Press Shift + Enter';

  var copyright = win.add('statictext', undefined, '\u00A9 Sergey Osokin. Visit Github');
      copyright.justify = 'center';

  var prgGroup = win.add('group');
      prgGroup.alignChildren = ['fill', 'fill'];
  var progBar = prgGroup.add('progressbar', undefined, 0, 100);
      progBar.preferredSize.height = 5;

  // LOAD
  updateInputText();

  // EVENTS
  newNameInp.onChange = function () {
    saveCurrentPage();
  }

  prevPageBtn.onClick = function () {
    saveCurrentPage();
    if (currPage > 1) {
      currPage--;
      updateInputText();
      pagInp.text = currPage;
    }

    // Reset button color after click
    this.active = true;
    this.active = false;

    this.enabled = currPage > 1;
    nextPageBtn.enabled = currPage < totalPages;
  };

  nextPageBtn.onClick = function () {
    saveCurrentPage();
    if (currPage < totalPages) {
      currPage++;
      updateInputText();
      pagInp.text = currPage;
    }

    // Reset button color after click
    this.active = true;
    this.active = false;

    this.enabled = currPage < totalPages;
    prevPageBtn.enabled = currPage > 1;
  };

  pagInp.onChange = function() {
    saveCurrentPage();
    currPage = parseInt(this.text);
    if (isNaN(currPage)) currPage = 1;

    if (currPage < 1) {
      currPage = this.text = 1;
    } else if (currPage > totalPages) {
      currPage = this.text = totalPages;
    }

    prevPageBtn.enabled = currPage > 1;
    nextPageBtn.enabled = currPage < totalPages;

    updateInputText();
  };

  closeBtn.onClick = win.close;

  matchBtn.onClick = function () {
    this.text = 'Wait...';
    resLabel.text = resLabel.text.replace(/\d+/, 0);
    var tolerance = strToNum(tolInput.text, CFG.defTolerance)
    var result = findSwatchNames(selSwatches, tolerance, unselSwNames, win, progBar);

    if (result.founded === 0) {
      alert('No names found\nTry a different value of the tolerance', 'Script Tip');
    }

    existsCount = result.exists ? result.exists : 0;

    editedNames = result.names.slice();
    updateInputText();
    resLabel.text = resLabel.text.replace(/\d+/, result.founded);

    this.text = 'Match Names';
    this.active = true;
    this.active = false;
  }

  okBtn.onClick = function () {
    renameSwatches(selSwatches, editedNames);

    if (existsCount) {
      alert('Swatch Names Conflict\nThe document contains ' + existsCount 
        + ' swatches with the same names. Sequential numbers have been added', 'Script Notice');
    }

    win.close();
  }

  win.addEventListener('keydown', function(kd) {
    if (ScriptUI.environment.keyboardState.shiftKey && kd.keyName === 'Enter') {
      renameSwatches(selSwatches, editedNames);
      win.close();
    }
  });

  copyright.addEventListener('mousedown', function () {
    openURL('https://github.com/creold/');
  });

  // Update the input text fields with the current page of edited names
  function updateInputText() {
    // Calculate the start and end indices for the current page
    var start = (currPage - 1) * CFG.namesPerPage;
    var end = Math.min(start + CFG.namesPerPage, editedNames.length);
    
    // Set the text for the current page
    newNameInp.text = editedNames.slice(start, end).join('\n');
    oldNameInp.text = selSwNames.slice(start, end).join('\n');
  }

  // Save the current page of edited names to array
  function saveCurrentPage() {
    var start = (currPage - 1) * CFG.namesPerPage;
    var lines = newNameInp.text.split('\n');

    for (var i = 0; i < lines.length; i++) {
      if (start + i < editedNames.length) {
        editedNames[start + i] = lines[i];
      }
    }
  }

  win.defaultElement = matchBtn;
  win.center();
  win.show();
}

/**
 * Get the colors of the selected swatches in a given document
 * @param {Object} doc - The document object containing swatches
 * @returns {Array} result - An array of color objects from the selected swatches
 */
function getSwatches(doc) {
  var result = [];

  var swatches = doc.swatches.getSelected();
  if (!swatches.length) swatches = doc.swatches;

  for (var i = 0; i < swatches.length; i++) {
    try {
      var sw = swatches[i];
      var swColor = sw.color;

      if (/nocolor|gradient|pattern/i.test(swColor)) {
        continue;
      }
      if (/spot/i.test(swColor.typename) && swColor.spot.colorType == ColorModel.REGISTRATION) {
        continue;
      }
  
      result.push(sw);
    } catch (err) {}
  }

  return result;
}

/**
 * Get the names of all swatches in an array
 * @param {Array} swatches - An array of swatch objects
 * @returns {Array} - An array of swatch names
 */
function getSwatchNames(swatches) {
  if (!swatches.length) return [];
  var result = [];

  for (var i = 0, len = swatches.length; i < len; i++) {
    try {
      result.push(swatches[i].name);
    } catch (err) {}
  }

  return result;
}

/**
 * Filter an array to exclude elements present in another array
 * @param {Array} arr1 - The original array to be filtered
 * @param {Array} arr2 - The array containing elements to exclude
 * @returns {Array} - A new filtered array
 */
function filterArray(arr1, arr2) {
  var result = [];
  var map = {};
  var i = 0, len = 0;

  for (i = 0, len = arr2.length; i < len; i++) {
    map[arr2[i]] = true;
  }

  for (i = 0, len = arr1.length; i < len; i++) {
    if (!map[arr1[i]]) result.push(arr1[i]);
  }

  return result;
}

/**
 * Rename swatches in an array from a given array of names
 * @param {Array} swatches - An array of swatch objects
 * @param {Array} names - An array of swatch names
 */
function renameSwatches(swatches, names) {
  if (!names.length || !swatches.length) return;

  var len = Math.min(names.length, swatches.length);
  for (var i = 0; i < len; i++) {
    try {
      if (swatches[i].name !== names[i] && names[i].length) {
        swatches[i].name = names[i];
      }
    } catch (err) {}
  }
}

/**
 * Find new names for swatches based on their color and a tolerance level
 * Predefined color name lists ('HEX_DATA_*')
 * @param {Array} swatches - An array of swatch objects
 * @param {number} tolerance - A number representing the acceptable color difference for a match
 * @param {Array} existsNames - An array of swatch names of the current document
 * @returns {number} - The number of swatches successfully renamed
 */
function findSwatchNames(swatches, tolerance, existsNames, win, progress) {
  if (!swatches.length) {
    return { names: [], founded: 0 };
  }

  var isCMYK = /cmyk/i.test(app.activeDocument.documentColorSpace);
  var result = [];
  var matchedCount = 0;

  for (var i = 0, len = swatches.length; i < len; i++) {
    var sw = swatches[i];
    var swColor = /spot/i.test(sw.color.typename) ? sw.color.spot.color : sw.color;

    var swRgb = [];
    if (/gray/i.test(swColor)) {
      swRgb = grayToRgb([swColor.gray]);
    } else {
      swRgb = isCMYK ? cmykToRgb([swColor.cyan, swColor.magenta, swColor.yellow, swColor.black]) : [swColor.red, swColor.green, swColor.blue];
    }

    var swHex = rgbToHex(swRgb);

    var matchedName = '';

    switch (true) {
      case /#0/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_0, tolerance);
        break;
      case /#1/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_1, tolerance);
        break;
      case /#2/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_2, tolerance);
        break;
      case /#3/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_3, tolerance);
        break;
      case /#4/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_4, tolerance);
        break;
      case /#5/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_5, tolerance);
        break;
      case /#6/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_6, tolerance);
        break;
      case /#7/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_7, tolerance);
        break;
      case /#8/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_8, tolerance);
        break;
      case /#9/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_9, tolerance);
        break;
      case /#a/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_A, tolerance);
        break;
      case /#b/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_B, tolerance);
        break;
      case /#c/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_C, tolerance);
        break;
      case /#d/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_D, tolerance);
        break;
      case /#e/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_E, tolerance);
        break;
      case /#f/i.test(swHex):
        matchedName = findMatches(swHex, HEX_DATA_F, tolerance);
        break;
      default:
        break;
    }

    if (matchedName.length && matchedName !== sw.name) {
      matchedCount++;
    }

    result.push(matchedName.length ? matchedName : sw.name);

    progress.value = parseInt(100 * (i + 1) / len);
    win.update();
  }

  var existsCount = countMatches(result, existsNames);
  result = fixMatchedStrings(result, existsNames);

  return { names: result, founded: matchedCount, exists: existsCount };
}

/**
 * Convert GRAY color to RGB color space using the native converter
 * @param {Array} gray - An array of GRAY values
 * @returns {Array} - An array of RGB values [red, green, blue]
 */
function grayToRgb(gray) {
  return app.convertSampleColor(ImageColorSpace.GrayScale, gray, ImageColorSpace.RGB, ColorConvertPurpose.defaultpurpose);
}

/**
 * Convert CMYK color to RGB color space using the native converter
 * @param {Array} cmyk - An array of CMYK values [cyan, magenta, yellow, black]
 * @returns {Array} - An array of RGB values [red, green, blue]
 */
function cmykToRgb(cmyk) {
  return app.convertSampleColor(ImageColorSpace.CMYK, cmyk, ImageColorSpace.RGB, ColorConvertPurpose.defaultpurpose);
}

/**
 * Convert RGB color values to a HEX string
 * @param {Array} rgb - An array representing the red, green, and blue components
 * @returns {string} - The HEX representation of the color
 */
function rgbToHex(rgb) {
  return '#' + componentToHex(rgb[0]) + componentToHex(rgb[1]) + componentToHex(rgb[2]);
}

/**
 * Convert a color component to a hexadecimal string
 * @param {number} c - The color component (0-255)
 * @returns {string} - The hexadecimal representation of the color component
 */
function componentToHex(c) {
  var hex = c.toString(16);
  return hex.length == 1 ? '0' + hex : hex;
}

/**
 * Convert a HEX color code to an RGB color object
 * @param {string} hex - The HEX color code (with or without the '#' symbol)
 * @returns {Object} - An object representing the RGB values {red, green, blue}
 */
function hexToRgb(hex) {
  var hex = hex.replace(/[^0-9A-F]/gi, '');
  if (hex.length === 3) {
    hex = hex[0] + hex[0] + hex[1] + hex[1] + hex[2] + hex[2];
  } else if (hex.length && hex.length < 6) {
    hex = ('000000' + hex).slice(-6);
  }
  return {
    red: hex.length ? parseInt(hex.substr(0, 2), 16) : 0,
    green: hex.length ? parseInt(hex.substr(2, 2), 16) : 0,
    blue: hex.length ? parseInt(hex.substr(4, 2), 16) : 0
  };
}

/**
 * Find the closest matching color name from a data set based on a provided hex string and tolerance level
 * @param {string} str - The hex string representing the color to match
 * @param {Array} data - An array of objects, each with a hex property and a color name property
 * @param {number} tolerance - A number representing the acceptable color difference for a match
 * @returns {string} - The closest matching color name from the data set, or an empty string if no match is found
 */
function findMatches(str, data, tolerance) {
  var closestColor = null;
  var closestDist = Infinity;

  for (var i = 0, len = data.length; i < len; i++) {
    if (str === data[i].hex) return data[i].name;
  }

  var inputRgb = hexToRgb(str);

  for (var j = 0; j < data.length; j++) {
    var currRgb = hexToRgb(data[j].hex);
    var dist = colorDistance(inputRgb, currRgb);

    if (dist < closestDist && dist <= tolerance) {
      closestDist = dist;
      closestColor = data[j].name;
    }
  }

  return closestColor || '';
}

/**
 * Count the number of matches between two arrays of strings
 * @param {string[]} arr1 - The first array
 * @param {string[]} arr2 - The second array
 * @returns {number} - The number of matches found
 */
function countMatches(arr1, arr2) {
  var result = 0;

  for (var i = 0; i < arr1.length; i++) {
    for (var j = 0; j < arr2.length; j++) {
      if (arr1[i] === arr2[j]) {
        result++;
        break;
      }
    }
  }

  return result;
}

/**
 * Find string matches in an array and appends a sequence number
 * Unique strings remain unchanged
 * @param {Array} arr - An array of strings
 * @param {Array} existsArr - An array of existing strings
 * @returns {Array} - An array of results
 */
function fixMatchedStrings(arr, existsArr) {
  var result = [];
  var matches = {};
  var i = 0, len = 0;

  // Initialize matches based on existsArr to continue sequence numbers
  for (i = 0, len = existsArr.length; i < len; i++) {
    // Strip any trailing number
    var baseName = existsArr[i].replace(/\s\d+$/, '');
    var currIdx = parseInt(existsArr[i].match(/\d+$/), 10);

    if (isNaN(currIdx)) {
      matches[baseName] = matches[baseName] || 1;
    } else {
      matches[baseName] = Math.max(matches[baseName] || 1, currIdx + 1);
    }
  }

  for (i = 0, len = arr.length; i < len; i++) {
    var str = arr[i];

    if (matches[str]) {
      result.push(str + ' ' + matches[str]);
      matches[str]++;
    } else {
      matches[str] = 1;
      result.push(str);
    }
  }

  return result;
}

/**
 * Calculate the Euclidean distance between two RGB color objects
 * @param {Object} rgb1 - An object with `red`, `green`, and `blue` properties (0-255)
 * @param {Object} rgb2 - Another object
 * @returns {number} - The Euclidean distance between the two RGB colors
 */
function colorDistance(rgb1, rgb2) {
  return Math.sqrt(
    Math.pow(rgb1.red - rgb2.red, 2) +
    Math.pow(rgb1.green - rgb2.green, 2) +
    Math.pow(rgb1.blue - rgb2.blue, 2)
  );
}

/**
 * Convert string to absolute number
 * @param {string} str - The string to convert to a number
 * @param {number} def - The default value to return if the conversion fails
 * @returns {number} - The converted number
 */
function strToNum(str, def) {
  if (arguments.length == 1 || def == undefined) def = 1;
  str = str.replace(/,/g, '.').replace(/[^\d.]/g, '');
  str = str.split('.');
  str = str[0] ? str[0] + '.' + str.slice(1).join('') : '';
  if (isNaN(str) || !str.length) return parseFloat(def);
  else return parseFloat(str);
}

/**
 * Open a URL in the default web browser
 * @param {string} url - The URL to open in the web browser
 * @returns {void}
*/
function openURL(url) {
  var html = new File(Folder.temp.absoluteURI + '/aisLink.html');
  html.open('w');
  var htmlBody = '<html><head><META HTTP-EQUIV=Refresh CONTENT="0; URL=' + url + '"></head><body> <p></body></html>';
  html.write(htmlBody);
  html.close();
  html.execute();
}

